            var html_91c6784be1954a428453082d7c182396 = $(`<div id="html_91c6784be1954a428453082d7c182396" style="width: 100.0%; height: 100.0%;">Stage 19: Haut Languedoc <br>                  111km,                   2589m ascent <br>                 Crazy day. Started with the pic nore, the local version of ventoux, though the perhaps the view is even better. I could even see the Tourmalet, over 200km away. My route builder chose a terrible way off this, a full on mountain bike track that got proper gnarly man, and then turned into a ski slope, and then turned into nothing at all. I had to walk about 5km downhill which took a very long time. Followed an old railway line up the valley (cool tunnels), then climbed up onto the plateau. The descent off col fontfroide was spectacular - long, fast and sweeping. Ended the day with a climb up the Héric gorges to see the almost-abandoned village, which was very eerie, and then headed back down to watch a tight game of pétanque. <br>                 <a href="https://www.strava.com/activities/6048964998">Strava link</a> </div>`)[0];
            popup_02735b4f1de649e78cd1a90d3e2a5e60.setContent(html_91c6784be1954a428453082d7c182396);
        

        marker_aeb8b0ab8cb340ec948a0833d8cbd0b0.bindPopup(popup_02735b4f1de649e78cd1a90d3e2a5e60)
        ;

            var html_e5330e73fb09414d8fb9c00d1cb4e3cb = $(`<div id="html_e5330e73fb09414d8fb9c00d1cb4e3cb" style="width: 100.0%; height: 100.0%;">Stage 20: L'Hérault <br>                  91km,                   1616m ascent <br>                 Hot, lumpy and windy (behind me for once). It being market day meant the bakeries had sold out of pretty much everything, but the local dancing was on show instead. Then climbed up a valley to visit the least used train station in France with 200 passengers/year (the line itself is a heroic piece of engineering). Towards the end of the day the wind really started to pick up (an ‘episode cevenol’ aka massive storm was forecast). Stopped off to visit the fortified village of St Jean d’Aclas and was promptly invited to have dinner and stay the night to sit out the storm. So, I write this to you from a priests lodgings dating from 1200! <br>                 <a href="https://www.strava.com/activities/6059154375">Strava link</a> </div>`)[0];

            var html_0baedeaf900d49198b1bffd8e7bc7195 = $(`<div id="html_0baedeaf900d49198b1bffd8e7bc7195" style="width: 100.0%; height: 100.0%;">Stage 24: Lozère <br>                  118km,                   2372m ascent <br>                 Most satisfying ride ever? Day started off bright and very cold as I tracked up the stunning gorges du Tarn. Then climbed up mont Lozère (col finiels, fabulous road and very consistent gradients). There was a bitterly cold headwind up on the plateau that was against me for the remainder of the day. The exposure up there is severe. Just when I was starting to get properly hacked off with it all the end point came into site - an unmanned mountain refuge. There’s a fireplace, bunk bed and armchair, and I’ve got the place all to myself. Never been happier to finish a ride! <br>                 <a href="https://www.strava.com/activities/6079160822">Strava link</a> </div>`)[0];
            popup_441092c5770a4ae0859f58e715795dd6.setContent(html_0baedeaf900d49198b1bffd8e7bc7195);

            var html_a93630fc92364cc2a64599f2167703ca = $(`<div id="html_a93630fc92364cc2a64599f2167703ca" style="width: 100.0%; height: 100.0%;">Stage 32: Cols de Izoard, Lautaret, Galibier <br>                  107km,                   3132m ascent <br>                 The queen stage of my tour. Izoard was new to me, as was the Lautaret and Galibier from Briancon. Day started cold but heated up fast, and so the Lautaret turned into an all out slog: the sun was beating, the wind was blowing down the valley and the road was busy and exposed. It was getting late by the time I made it up the Galibier and the light was spectacular. One final surprise in store: the north face had a fair amount of snow and ice hiding in the shade, so it was a slow and careful descent. Stayed in Valloire with Jean Louis and Ghislaine, who stuffed me full of Provençal cuisine and then sent me straight off to bed! I was spent. <br>                 <a href="https://www.strava.com/activities/6123041644">Strava link</a> </div>`)[0];
            popup_28ab52f62059468791efc2916d27bebf.setContent(html_a93630fc92364cc2a64599f2167703ca);

            var html_7217bbfd2dc6452f8fc960c4a2283200 = $(`<div id="html_7217bbfd2dc6452f8fc960c4a2283200" style="width: 100.0%; height: 100.0%;">Stage 42: Aube <br>                  137km,                   1096m ascent <br>                 Another beautiful morning with pockets of mist lingering in every valley until midday. Visited the grave of Charles de Gaulle (decent amount of tourist traffic), passed through the wonderful forest and lakes of Orient, and finished up in Troyes, a wonderful little city. For the first time ever, I had two coffees at lunch and seemed to get a second third and fourth wind all at the same time. I was riding like a man possessed through the second half of this (relatively speaking, it’s hard to make a touring bike move fast!) <br>                 <a href="https://www.strava.com/activities/6187410879">Strava link</a> </div>`)[0];
